(function($,window,document){var $window=$(window);$.fn.lazyimage=function(options){var loadImages=$(this);var settings={lazyTime:1000,preload:"data:image/png;base64,"};$.extend(settings,options);function updateImg(){loadImages.not("[loaded]").each(function(){$(this).attr("src",settings.preload)});setTimeout(function(){loadImages.not("[loaded]").each(function(){var original=$(this).attr("data-original");$(this).attr("src",original);$(this).attr("loaded","loaded")})},settings.lazyTime)}loadImages.bind("error",function(){$(this).attr("src",settings.preload)});$(document).ready(function(){updateImg()})}})(jQuery,window,document);